import React from 'react'

const Audio = ({ audio }) => {
    return (
        <div>
            {audio.previewURL}
            <button onClick={this.togglePlay}>{this.state.play ? 'Pause' : 'Play'}</button>
        </div>
    );
}
export default Audio;
